import React from 'react';
import NavBar from './components/navbar';
import Main from './components/main';
import './App.css';
import HeadTitle from './components/head_title';


function App() {
  return (
    <React.Fragment>
     
      <HeadTitle/>
      <br></br>
      <Main />
    </React.Fragment>
  );
}

export default App;
